import styles from './Navigation.module.css'
import {Card} from 'react-bootstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Cart = () => {
    return(
        <Card style={{display: 'inline-block'}}>
            <img src="https://media.istockphoto.com/vectors/shopping-cart-icon-isolated-on-white-background-vector-id1206806317?s=612x612" alt="Italian Trulli" style={{width:"30px", height:"30px"}}/>
            <div className={styles.cart}>Your Cart</div>
        </Card>
    )
}

export default Cart;
